&gt; She advanced and descended lower. At the end of the pipe, she came in
&gt; a large vault-like place. She saw a ledge and jumped on it, but her
&gt; clawed feet made a scraping sound that echoed all around. Mentally,
&gt; she swore and her hunter instincts kicked in. The lioness had to find
&gt; her prey now!
&gt; 

Stopping dead in her tracks, she heard something. Being a Decepticon Recon 
agent didn&#39;t mean for her to take any little thing lightly. 

She listened, her hearing different than what she was used to. She was able 
to .. smell, as well. Odd,.. another thing she was not used to. 

Cautiously, she stepped forward very slowly with each step. She could tell 
something was nearby. Her clear blue eyes glanced about. Taking one step at a 
time, slowly. She would be on alert, ready to defend or attack if she were 
jumped. She cursed being in this form. In her warrior form, she was dangerous 
enough & could lay waste nearly anything that was within her path. 


